                            <button type="button" className="btn-start btn btn-primary" onclick='start();'>세렝게티 동물로 알아보기</button>
                            <img className="ml-3" src="img/double-slash-right.png" alt="double-slash-right">
                        </div>
                        <img className="updown-slash" src="img/down-slash.png" alt="up-slash"> */}
                    </article>
                </div>
